function App() {
  return (
    <Router>
      <div>
        <Nav />
        <Books />
        <Route exact path="/" component={Home} />
        <Route exact path="/Books" component={Books} />
        <Route exact path="/Detail" component={Detail} />
        <Route path="/NoMatch" component={NoMatch} />
